import React from "react";
import Github from "../../assets/img/Github.svg";
import linkedin from "../../assets/img/linkedin.svg";
import AnimatedGithub from "../../assets/img/githubani.gif";

function Footer() {
  return (
    <footer>
      Created by Denisse Rivera
      <p>
        <img src={AnimatedGithub} alt="Github" />
        <a href="https://github.com/RiveraDenisse"></a>
      </p>
      <p>
        <img src={linkedin} alt="Linkedin" />
        <a href="http://linkedin.com/in/riveradenisse">Linkedin</a>
      </p>
    </footer>
  );
}

export default Footer;
